import React from "react";

const SignUp = () => {
  return (
    <div className="w-full centered-items p-10  border-2 ">
      <div className="w-3/12 p-4 border-2 shadow-xl space-y-4">
        <div>
          <span className="font-bold text-3xl">Sign Up</span>
          <span className="text-sm text-gray-500">
            Make the most of professional life
          </span>
        </div>

        <div>
         
        </div>

        <div>
          <label htmlFor="idValue" className="text-sm text-gray-500 ">
            E-mail
          </label>
        </div>
      </div>
    </div>
  );
};

export default SignUp;
